import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ProtectedRoute from './components/ProtectedRoute';
import AdminLayout from './components/AdminLayout'; // Add this import
import CustomerLayout from './components/CustomerLayout'; // Add this import
import HomePage from './components/HomePage'; // Add this import

function App() {
    return ( <
        Router >
        <
        div className = "App" >
        <
        Routes >
        <
        Route path = "/admin/*"
        element = { <
            ProtectedRoute >
            <
            AdminLayout / >
            <
            /ProtectedRoute>
        }
        /> <
        Route path = "/customer/*"
        element = { < CustomerLayout / > }
        /> <
        Route path = "/"
        element = { < HomePage / > }
        /> <
        /Routes> <
        /div> <
        /Router>
    );
}

export default App;
